New Interview - Our interview series continue with @kid_richards , a very talented photographer based in Lisbon. Head to our website or link in bio to discover the full interview, below an excerpt:
OM - Can you share some of your most memorable photography experiences? 

@kid_richards - "Probably the whole process of doing my first book “Let’s get lost here”. It was really amazing, between Milan & Lisbon for some months. Mainly because it was so personal, I was totally exposing myself and what I was feeling. I needed to do that to heal. It took a whole year to finish, so it was an overwhelming experience."

